import React from "react";

import "./App.css";

export default function Links() {
  return (
    <div>
      <p className="links">
        <a
          href="https://github.com/thandierab/weather-react-search"
          target="blank"
          title="Github"
        >
          Coded
        </a>{" "}
        by Thandie R-mane.
      </p>
    </div>
  );
}
